style.css:
@-moz-document url-prefix("https://www.roblox.com/transactions") {
/* Hide the actual pending Robux amount */
    span[class] {
        visibility: hidden !important;
    }

    /* Inject the fake amount after the hidden original amount */
    span[class]:after {
        content: '9,000';
        visibility: visible;
        position: relative;
        left: 0;
        top: 0;
        color: #333; /* Adjust the color to match the site's theme */
        font-size: 16px; /* Adjust the font size to match surrounding text */
    }
}
